import { useSelector } from 'react-redux';
const Teacher = () => {
  let state = useSelector((state) => state.admin);

  return (
    <>
      {
        state.timetable.map((time) =>{
          const {class_Name, student_Name, teacher_Name} = time
          console.log(time)

        })
      }

      <table>
        <tr>
          <th>Month</th>
          <th>Savings</th>
        </tr>
        <tr>
          <td>January</td>
          <td>$100</td>
        </tr>
        <tr>
          <td>February</td>
          <td>$80</td>
        </tr>
      </table>
    </>
  )
}

export default Teacher
